                                            "about": "<p>Gặp nhau là duyên, bên nhau là nợ. Đến khi duyên nợ đủ đầy, chúng tôi quyết định để chuyện tình này bước qua ngưỡng cửa hôn nhân, từ nay cùng nhau vun xây một gia đình <a rel=\"noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer\" target=\"_blank\" href=\"https:\/\/meta.vn\/huong-dan\/tong-hop\/hanh-phuc-la-gi-9317\">hạnh phúc<\/a>. Sự hiện diện của bạn là niềm vinh hạnh cho gia đình chúng em.<\/p>\n<p>Tình yêu trao cho trái tim quyền năng mạnh nhất, đó chính là quyền tin vào những giá trị thực trên đời. <a rel=\"noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer noopener noreferrer\" target=\"_blank\" href=\"https:\/\/meta.vn\/huong-dan\/tong-hop\/tinh-yeu-chan-chinh-la-gi-7721\">Tình yêu<\/a> cho chúng ta niềm tin rằng chuyện gì cũng đều có cách giải quyết, chỉ cần một người ở lại và yêu mình thì cuộc sống này luôn đáng sống.<\/p>",
